class Submission:
    def __init__(self, user_id, content):
        self.user_id = user_id
        self.content = content
        self.status = "draft"  # possible statuses: draft, published, rejected

    def publish(self):
        self.status = "published"

    def reject(self):
        self.status = "rejected"


class SubmissionManager:
    def __init__(self):
        self.submissions = []

    def submit_record(self, user_id, content):
        submission = Submission(user_id, content)
        self.submissions.append(submission)
        return submission

    def view_submissions(self, user_id):
        return [submission for submission in self.submissions if submission.user_id == user_id]

    def validate_submission(self, submission):
        # Example validation rules
        if not submission.content or len(submission.content) < 10:
            return False
        return True


class Developer:
    def __init__(self, submission_manager):
        self.submission_manager = submission_manager

    def update_validation_rules(self, new_validation_function):
        self.submission_manager.validate_submission = new_validation_function


class HistoricalDataLoader:
    def __init__(self):
        self.history = []

    def load_historical_data(self, data):
        self.history.extend(data)


class DesignSubmission:
    def __init__(self, designer_id, design_content):
        self.designer_id = designer_id
        self.design_content = design_content
        self.status = "pending"  # possible statuses: pending, approved, rejected

    def approve(self):
        self.status = "approved"

    def reject(self):
        self.status = "rejected"


class DesignManager:
    def __init__(self):
        self.designs = []

    def submit_design(self, designer_id, design_content):
        design = DesignSubmission(designer_id, design_content)
        self.designs.append(design)
        return design

    def track_issues(self):
        return [design for design in self.designs if design.status != "approved"]


# Example usage
submission_manager = SubmissionManager()
developer = Developer(submission_manager)
historical_data_loader = HistoricalDataLoader()
design_manager = DesignManager()

# User submits a record
record = submission_manager.submit_record("user1", "This is a sample submission")
if submission_manager.validate_submission(record):
    record.publish()

# User views submissions
user_submissions = submission_manager.view_submissions("user1")

# Developer updates validation rules
def custom_validation(submission):
    return submission.content and len(submission.content) >= 5

developer.update_validation_rules(custom_validation)

# Loading historical data
historical_data_loader.load_historical_data([{"id": 1, "content": "Old submission"}])

# UI designer submits a design
design = design_manager.submit_design("designer1", "Sample design for approval")
